import React from "react";
import "./register.css";

function Register() {
  const closeRegister = () => {
    document.getElementById("signBtn").setAttribute("disabled", "disabled");
    document.getElementById("regcontainer").style.top = "100%";
  };

  return (
    <div className="register-container" id="regcontainer">
      <div className="exit" onClick={closeRegister}>
        <div className="line1"></div>
        <div className="line2"></div>
      </div>
      <div className="reg-head">
        <h1>Sign Up</h1>
        <input type="email" name="email" id="" placeholder="E-Mail ID..." />
        <input
          type="password"
          name="password"
          id=""
          placeholder="Password..."
        />
        <input
          type="password"
          name="confirmpass"
          id=""
          placeholder="Comfirm Password..."
        />
        <button id="signBtn" disabled>
          Register
        </button>
      </div>
    </div>
  );
}

export default Register;
